tables.table_schema:
CREATE TABLE wildlife_population_data (
    id INT PRIMARY KEY,
    species_name VARCHAR(255),
    population_size INT,
    habitat_type VARCHAR(255)
);

CREATE TABLE habitat_preservation_data (
    id INT PRIMARY KEY,
    habitat_name VARCHAR(255),
    location VARCHAR(255),
    protected_area BOOLEAN
);

CREATE TABLE wildlife_population (
    id INT PRIMARY KEY,
    species VARCHAR(255) NOT NULL,
    population_count INT NOT NULL,
    habitat_id INT NOT NULL,
    observation_date DATE
);

CREATE TABLE habitat (
    id INT PRIMARY KEY,
    name VARCHAR(255) NOT NULL,
    location VARCHAR(255) NOT NULL,
    area DOUBLE NOT NULL
);

CREATE TABLE observation (
    id INT PRIMARY KEY,
    observation_date DATE NOT NULL,
    species VARCHAR(255) NOT NULL,
    observation_details TEXT
);

CREATE TABLE conservation_efforts (
    id INT PRIMARY KEY,
    description TEXT NOT NULL,
    date_initiated DATE NOT NULL,
    success_rate DOUBLE
);

CREATE TABLE WildlifeSpecies (
  species_id INT PRIMARY KEY,
  species_name VARCHAR(100) NOT NULL,
  population INT,
  habitat VARCHAR(100)
);

CREATE TABLE Habitats (
  habitat_id INT PRIMARY KEY,
  habitat_name VARCHAR(100) NOT NULL,
  habitat_type VARCHAR(50)
);
